materials.fragmentShader:
//header-begin
uniform float iTime;
uniform vec2 iResolution;
uniform sampler2D iDepthTexture;
uniform sampler2D iSceneTexture;
uniform float iCameraNear;
uniform float iCameraFar;
uniform sampler2D iTexture0;
uniform mat4 iWorld2ObjectMatrix;
//header-end
varying vec3 fPosition;
varying vec3 fNormal;
varying vec2 fUV;


#define round(x) floor(x+0.5);
#define PI 3.14159265358979323846

float widthRange = 0.064;
float scale = 15.0;
float alpha = 1.0;

float square(vec2 r, vec2 center, float width, float a){
    r = abs( mat2(cos(a),-sin(a),sin(a),cos(a)) *(r - center) );    
    return alpha*smoothstep(0.05, -0.05, max(r.x, r.y)-width/2.);
}

float rand(vec2 co){
    return fract(sin(dot(co.xy ,vec2(12.9898,78.233))) * 43758.5453);
}

float grid(vec2 r, float scale)
{
    vec2 rr;

    float angle = 0.0;
    float mask = 0.0;
    float widthFreq;
    float widthPhase;
    float squareWidth;

    //iterate the 3x3 grid surrounding r
    //see if im in any of the boxes
    for(int i = -1; i < 2; ++i)
    {
        for(float j = -1.0; j < 2.0; ++j)
        {
            rr = round(r*scale + vec2(i,j));

            //Uncomment this for angle modulation
            //angle = 3.0*(rand(vec2(rr + 0.1)) - 1.0)*iTime/3.0;
            widthPhase = rand(vec2(rr + 0.2));
            widthFreq = 15.0*rand(vec2(rr + 0.3));
            squareWidth = rand(vec2(rr))*scale*(widthRange + widthRange*sin(iTime*widthFreq + widthPhase));

            mask += square(r*scale, rr, squareWidth, angle);
        }
    }


    return mask;
}


void main()
{
    vec2 r =fUV;

    widthRange = 0.168 * (sin(iTime) + 1.0);
    vec4 noise = vec4(grid(r, scale));
    r += noise.xy * 0.3;
    vec4 mainColorOri = texture2D(iTexture0, fUV);
    vec4 mainColorDisp = texture2D(iTexture0, r);
    noise.a = mainColorOri.a;
    mainColorDisp.a = mainColorOri.a;
    //float t = 0.5 * (sin(iTime) + 1.0);
    //vec4 ret = mix(noise,mainColorDisp,t);
    vec4 ret = mainColorDisp;
	gl_FragColor = ret;


}

